import React, { Component } from 'react';
import './App.css';
import SideBar from './componentes/SideBar';
import simple from './averysimplecomponent'
import {BrowserRouter, Route, Switch} from 'react-router-dom'

function intento () {
  return (
    <p>
      holiwis
    </p>
  )
}



class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Switch>
          <Route path="/" Component={intento}/>
        </Switch>
      </BrowserRouter>
    );
  }
}

export default App;
